import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/dashboard/home";
import Login from "./pages/login/login";

function App() {
  return (
    <>
    <div id="wrapper">
      <Router>
        <Routes>
          <Route path="/" element={<Login/>}/>
          <Route path="/home" element={<Home/>}/>
        </Routes>
      </Router>
    </div>
    </>
  );
}

export default App;
